import React, { Component } from "react";

export class Pagination extends Component {
  render() {
    return (
      <div>
        <ul class="pagination">
          <li class="page-item">
            <a class="page-link" href="#">
              Previous
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              1
            </a>
          </li>
          <li class="page-item">
            <a class="page-link" href="#">
              2
            </a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Pagination;
